  false,\n\t\"url\": null,\n\t\"notes\": \"Single-beam bathymetry data along with
  DGPS navigation data was collected as part of the U.S. Geological Survey cruise
  1990-027-FA. The cruise was conducted in Gulf of Farallones, Northern California
  from August 5 to August 17, 1990. The chief scientists were Herman Karl , Dave Drake,
  and Bill Schwaball from the USGS Coastal and Marine Geology office in Menlo Park,
  CA. The geophysical source was a Knudsen 12 kHz 320B/R echosounder. These data are
  reformatted from space-delimited ASCII text files located in the Coastal and Marine
  Geology Program (CMGP) InfoBank field activity catalog at http://walrus.wr.usgs.gov/infobank/f/f890nc/html/f-8-90-nc.bath.html\",\n\t\"license_title\":
